import React from "react";
import logokmf from "../slike/kmflogo.png";
import logogav from "../slike/logogav.png";

export default function TopBar() {
    return (
        <div style={{
            display: "flex",
            alignItems: "center",
            justifyContent:"center",
            gap: "10px",
            backgroundColor: "white",
            padding: "10px 20px",
            borderBottom: "1px solid #ccc",
            fontFamily: "Arial, sans-serif"
        }}><img src={logokmf} alt="logo1" style={{ height: "50px" }} />
            <h1 style={{ margin: 0, color: "#085A48", fontSize: "24px" }}>KMF Vitez</h1>
            <br/>
            <p style={{ margin: 0, fontSize: "12px", color: "#666" }}>Green Army Vitez</p>
            <img src={logogav} alt="logo1" style={{ height: "60px" }} />
        </div>
    );
}
